import React from "react";
import { Card, } from "antd"
import { RetweetOutlined, HeartOutlined, MessageOutlined, EllipsisOutlined, Popover} from "@ant-design"

const PostCard = ({post}) => {
    return (
        <div>
            <Card
                cover={post.Images[0] && <PostImages images={post.images} />}
                actions={[
                    <RetweetOutlined />,
                    <HeartOutlined />,
                    <MessageOutlined />,
                    <Popover>
                        <EllipsisOutlined />,
                    </Popover>
                ]}>

            </Card>
        </div>
    )   
}

export default PostCard
